n el barrio de San Cristóbal, a dos cuadras de Avenida San Juan y dos de Avenida Jujuy, cuenta con excelentes medios de transporte: Subtes líneas E y H, Metrobus Chiclana y Metrobus Brasil e innumerables paradas de colectivo aledáneas.\r\nPor su cercanía a la Sede de la Jefatura de Gobierno de la Ciudad, al Parque de los Patricios y al Polo Tecnológico, es una de las zonas con mayor potencial de desarrollo en la Ciudad.\r\n\r\nEl edificio se compone de 7 pisos de viviendas aptas para uso profesional.-\r\n26 cocheras fijas cubiertas y descubiertas.\r\nLa planta baja cuenta con hall de ingreso en mármol, cielorraso suspendido con iluminación Led.\r\nAscensores de última generación, en acero inoxidable\r\nPalieres con pisos de porcelanato, paredes revestidas en papel vinílico.\r\n\r\nLos pisos 1 a 7, se componen de: \r\nUnidades de un ambiente divisible (ventilación e iluminación cruzadas)\r\nUnidades de 2 ambientes\r\nUnidades de 3 ambientes con dormitorio en suite y segundo baño.\r\n\r\nColectivos cercanos:\r\n4 | 6 | 8 | 31 | 32 | 41 | 53 | 56 | 57 | 61 | 62 | 75 | 86 | 88 | 91 | 96 | 97 | 101 | 118 | 126 | 127 | 129 | 134 | 143 | 188 | 195\r\n\r\nSubte y Trenes\r\n\r\nSubte: Linea E	Estación: General Urquiza	Av San Juan 3101-3151	A 4 cuadras de la propiedad\r\nSubte: Linea E	Estación: Jujuy	Av San Juan 2701	A 6 cuadras de la propiedad\r\nSubte: Linea H	Estación: Humberto I	Av. Jujuy 1100	A 6 cuadras de la propiedad\r\nSubte: Linea H	Estación: Inclan	Av. Jujuy 1700	A 6 cuadras de la propiedad','Sube el dólar, hora de invertir en construcción','El dólar sube nuestros precios bajan',NULL,1,'col-md-4 col-sm-6','2019-04-25 21:59:57','2019-04-25 22:02:27',NULL,0,0,'rgba(0,0,0,0)','[\"#063C4A\",\"#ACA199\",\"#63858E\",\"#F3F3F0\"]','#FFFFFF','#FFFFFF','#4f4f4f','76ff7d46-67a5-11e9-9e4b-fa163e1e9726','76ff8cbc-67a5-11e9-9e4b-fa163e1e9726',NULL,1,1,1,NULL,NULL,3,'7700b324-67a5-11e9-9e4b-fa163e1e9726',NULL,'76ff94f0-67a5-11e9-9e4b-fa163e1e9726',1,'4b320507-467b-11e9-9e4b-fa1