cheras en subsuelo\r\n4 en planta baja\r\nEn la planta baja, además, encontraremos departamentos de uno, dos y tres ambientes con excelentes patios.\r\nEn el 1er piso: uno, dos y tres ambientes.\r\nDesde el piso 2º al piso 3º, todos los departamentos con balcón.\r\nEn el piso 4º ubicamos: monoambientes, dos ambientes, tres ambientes.\r\nEl piso 5° cuenta con 4 unidades. Allí también se ubicará el SUM, tres parrillas, solarium, piscina, gym y laundry. \r\n\r\nUn edificio pensado para lograr un estilo de vida confortable, con todo lo necesario para el descanso y el disfrute. \r\nEstratégicamente ubicado, en uno de los polos gastronómicos de vanguardia, área de gran afluencia turística.','Desarrollo Inmobiliario San Telmo','Emprendimiento Inmobiliario, Distrito de las Artes',NULL,1,'col-md-4 col-sm-6','2019-04-10 20:52:59','2019-04-25 21:48:40',NULL,0,0,'transparent','[\"#063C4A\",\"#ACA199\",\"#63858E\",\"#F3F3F0\"]','#ffffff','#ffffff','#4f4f4f','9fcda858-5bd2-11e9-9e4b-fa163e1e9726','9fcdb78e-5bd2-11e9-9e4b-fa163e1e9726',NULL,1,1,0,NULL,NULL,3,'9fee8742-5bd2-11e9-9e4b-fa163e1e9726',NULL,'9fcdc28d-5bd2-11e9-9e4b-fa163e1e9726',1,'4b320507-467b-11e9-9e4b-fa163e1e9726','¡Muchas gracias por tu interés! En breve recibirás en tu email la información. Podes enviarnos un WhastApp al: +54 9 11 4181-1310.',NULL,0,0,0,'Invertir Construccion San Telmo','Departamentos venta San Telmo, Distrito de las Artes',1,0,'0.5',NULL),('a13abb3d-4b6d-11e9-9e4b-fa163e1e9726','de827981-3e03-11e9-bc5d-fa163e1e9726',NULL,'dasdas','https://land.page/cache/e/9/d/8/b/e9d8ba46781d17e502cc87b98fd4823287c083dd.jpeg',NULL,'dasdas','draft',NULL,'#732182',NULL,'template_1','2616636938','Min','mdampuero@gmail.com','dasdasdas','dasdasdsa','dsadsadsa',NULL,1,'col-md-4 col-sm-6','2019-03-21 00:09:44','2019-03-21 00:09:44',NULL,0,0,'rgba(0,0,0,0)','[\"#732182\",\"#D60036\",\"#77BB1F\",\"#F7B334\",\"#40B4E4\"]','#FFFFFF','#FFFFFF','#4f4f4f','a1058151-4b6d-11e9-9e4b-fa163e1e9726','a1058db5-4b6d-11e9-9e4b-fa163e