illas, SUM, gimnasio, laundry! Las unidades que se desarrollan son desde monoambientes hasta 3 ambientes. También contará con cocheras opcionales en subsuelo y planta baja. \r\nCon la dirección del Arq. Alejandro Aizersztein, asegurando un alto nivel de estética y pragmatismo.\r\n\r\nStep Bolívar cuenta con:\r\n32 cocheras en subsuelo\r\n4 en planta baja\r\nEn la planta baja, además, encontraremos departamentos de uno, dos y tres ambientes con excelentes patios.\r\nEn el 1er piso: uno, dos y tres ambientes.\r\nDesde el piso 2º al piso 3º, todos los departamentos con balcón.\r\nEn el piso 4º ubicamos: monoambientes, dos ambientes, tres ambientes.\r\nEl piso 5° cuenta con 4 unidades. Allí también se ubicará el SUM, tres parrillas, solarium, piscina, gym y laundry. \r\n\r\nUn edificio pensado para lograr un estilo de vida confortable, con todo lo necesario para el descanso y el disfrute. \r\nEstratégicamente ubicado, en uno de los polos gastronómicos de vanguardia, área de gran afluencia turística.','Productos','En San Telmo a tan sólo metros de Parque Lezama, del nuevo polo gastronómico y turístico, se abre paso Step Bolívar. Un excelente edifico que ofrece unidades de 35 a 146m2, con patio o balcón.\r\n¡Todos los amenities en un solo lugar, para encontrar el confort y el estilo de vida que te hará sentir increíble! Solarium, piscina, parrillas, SUM, gimnasio, laundry! Las unidades que se desarrollan son desde monoambientes hasta 3 ambientes. También contará con cocheras opcionales en subsuelo y planta baja. \r\nCon la dirección del Arq. Alejandro Aizersztein, asegurando un alto nivel de estética y pragmatismo.\r\n\r\nStep Bolívar cuenta con:\r\n32 cocheras en subsuelo\r\n4 en planta baja\r\nEn la planta baja, además, encontraremos departamentos de uno, dos y tres ambientes con excelentes patios.\r\nEn el 1er piso: uno, dos y tres ambientes.\r\nDesde el piso 2º al piso 3º, todos los departamentos con balcón.\r\nEn el piso 4º ubicamos: monoambientes, dos ambientes, tre