allos de fuerza avanzados impulsados ​​por la tecnología de batería REDLITHIUM ™ de Milwaukee. Más de 50 soluciones únicas hacen de la familia M12 ™ el sistema inalámbrico sub-compacto más grande del mercado.','2019-05-21 11:46:34','2019-05-24 12:56:03',0,'https://drive.google.com/open?id=1wUaU6TDq8bGqw6wTxlb2kRho0-wT65qh&amp;amp;amp;usp=sharing','+Donde compro...'),('1593beee-7bbe-11e9-9e4b-fa163e1e9726','aea6f088-7bbb-11e9-9e4b-fa163e1e9726','Línea inalámbrica M18 FUEL.','067387b91ee6c47d7d7a32b2bae1b086.jpeg','El sistema inalámbrico MILWAUKEE ® M18 ™ representa la máxima sinergia de potencia de grado profesional, peso ligero, rendimiento extremo y ergonomía superior. Desarrollado por la tecnología de batería REDLITHIUM ™ para un tiempo de ejecución inigualable, y junto con tecnologías patentadas, motores innovadores y electrónica avanzada, M18 ™ cambia el juego. Centrado en la mejora de la productividad para los profesionales de los oficios, de Milwaukee ® ofrece más de 175 soluciones en función de resultados que son totalmente compatibles con el M18 ™ de la familia - el de más rápido crecimiento del sistema inalámbrico de 18V en el mercado.','2019-05-21 11:46:34','2019-05-24 12:56:03',0,'https://drive.google.com/open?id=1wUaU6TDq8bGqw6wTxlb2kRho0-wT65qh&amp;amp;amp;usp=sharing','+Donde compro...'),('15a52e64-7bbe-11e9-9e4b-fa163e1e9726','aea6f088-7bbb-11e9-9e4b-fa163e1e9726','PACKOUT. Sistema de almacenamiento modular.','399103d3eb31ad7ebc8c2c21d9b31d63.png','Milwaukee Tool revoluciona el transporte, organización y almacenamiento de herramientas para los intercambios con el nuevo sistema de almacenamiento modular PACKOUT ™. Diseñado para brindar a los usuarios la capacidad de intercambiar e interbloquear una amplia variedad de cajas de herramientas, organizadores y bolsas de almacenamiento para trabajo pesado en múltiples configuraciones diferentes, PACKOUT ™ es el sistema de almacenamiento modular más versátil y duradero de la industria.','2019-05-21 11:46:34','2019-05-24 12:56:03',0,'https://drive.google.com/open?id=1wUaU6TDq8bGqw6wTxlb2kRho0-wT65qh&amp;amp;amp;usp=sharing','+Donde compro...'),('16bf7c63-78b4-11e9-9e4b-fa163e1e9726','9020d208-78b2-11e9-9e4b-fa163e1e9726','Baúl con ruedas','0f96a0426c47c1a2e92f02d257c5649b.png','- Fabricado con polímeros resistentes a los impactos para mayor durabilidad en la obra.\r\n- Empuñadura extensible de gran resistencia.\r\n- Ruedas todo terreno de 23 cm de diámetro.','2019-05-17 14:57:28','2019-05-17 14:57:28',0,'#contacto','+Info'),('16c4914c-78b4-11e9-9e4b-fa163e1e9726','9020d208-78b2-11e9-9e4b-fa163e1e9726','Bolso de Herramientas','ad72a36efb9a7a2fdb18f6482fdc3540.jpeg','- Forman parte del  sistema modular PACKOUT TM.\r\n- Construcción robusta: fabricados con nailon balístico de 1680 deniers.\r\n- Bases rígidas moldeadas, resistentes a los impactos y correas de hombro acolchadas.\r\n- Accesorios metálicos.\r\n','2019-05-17 14:57:28','2019-05-17 14:57:28',0,'#contacto','+Info'),('16d324d0-78b4-11e9-9e4b-fa163e1e9726','9020d208-78b2-11e9-9e4b-fa163e1e9726','Organizadores','87f2ce5fb655637e2d0daaa7dee2a0e1.png','- Estructura fabricada con polímeros resistentes a los impactos y la tapa \r\ntransparente en policarbonato, para mayor durabilidad en la obra.\r\n- Protección IP65 gracias a su junta de estanqueidad que evita la entrada de agua\r\no polvo.\r\n- Sistema, antimovimiento de las gavetas que evita que se muevan o mezclen los \r\nmateriales que contienen en el transporte.','2019-05-17 14:57:28','2019-05-17 14:57:28',0,'#contacto','+Info'),('1a50d4a6-40cd-11e9-99ef-fa163e1e9726','cf58ea52-40cb-11e9-99ef-fa163e1e9726','INSCRIPCION A LA EXPO','48712fa02ebc19a56e8997270a78c92d.png','Pre-inscripción al evento a través de eventbrite o mercadopago','2019-03-07 11:35:26','2019-03-07 11:35:26',0,'#contacto','Completa el formulario'),('253604ef-8653-11e9-85f2-fa163e1e9726','866b28fa-8652-11e9-85f2-fa163e1e9726','Soprano Ice Platinum','385245af715c134a25b7644d987b8f92.png','Soprano Ice P